import React from "react";
import SubscriptionListItemStyles from "./SubscriptionListItem.module.scss";
import AddIcon from '@mui/icons-material/Add';

function SubscriptionListItem() {
  return (
    <div className={SubscriptionListItemStyles.catalogItemWrapper}>

        <div className={SubscriptionListItemStyles.catalogLogoWrapper}>
            <img alt="logo"/>
        </div>

        <div className={SubscriptionListItemStyles.catalogNamingWrapper}>
            <p className={SubscriptionListItemStyles.catalogName}>
                Service Name
            </p>
            <p className={SubscriptionListItemStyles.catalogCashback}>
                Cashback
            </p>
        </div>
        <span className={SubscriptionListItemStyles.catalogItemButton}>
            <AddIcon />
        </span>
    </div>
  );
}

export default SubscriptionListItem;
